import React, { Component } from 'react';

const Container = styled.div``;

const Info = () => {
  return (
    <Container>
      <p>Total Kasus Covid19 di Indonesia</p>
      <ul>
        <li>Dikonfirmasi: 170 rb </li>
        <li>Sembuh: 82.236 </li>
        <li>Meninggal: 5.765 </li>
      </ul>
    </Container>
  )
}

export default Info
